import "./css/contact.css"

function ContactPage() {
    return ( 
    <div className="contact">
        <div className="contact_container">
            My Mobile Phone number: <b>778-861-8003</b> 
        </div>
        <div className="contact_container">
            My Email: <b>kedong0213@gmail.com</b>
        </div>
        <div className="contact_container">
            Github profile: <a href="https://github.com/KennyDev0213"> Github</a>
        </div>
        <div className="contact_container">
            Itch.io page: <a href="https://kennydev0213.itch.io/">Itch.io</a>
        </div>
    </div>
    );
}

export default ContactPage;
